

class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        sorted_s = sorted(s)
        sorted_t = sorted(t)
        for idx in range(len(sorted_s)):
            if sorted_s[idx] != sorted_t[idx]:
                return sorted_t[idx]
        return sorted_t[-1]


if __name__ == '__main__':
    s = ""
    t = ""
    result = Solution().findTheDifference(s, t)
    print(result)